source":["<font size=\"3\">After the data exploration, I was ready to develop a model. I chose the logit model since the dependent variable is a binary dependent variable. Based on the data exploration above, I selected 'age', 'avg_glucose_level', 'BMI', 'ever_married', and 'smoking_status' as independent variables. </font>"]},{"cell_type":"code","execution_count":16,"id":"203ebc95","metadata":{"execution":{"iopub.execute_input":"2022-12-11T02:50:20.414606Z","iopub.status.busy":"2022-12-11T02:50:20.412955Z","iopub.status.idle":"2022-12-11T02:50:20.515918Z","shell.execute_reply":"2022-12-11T02:50:20.512001Z"},"papermill":{"duration":0.126412,"end_time":"2022-12-11T02:50:20.520831","exception":false,"start_time":"2022-12-11T02:50:20.394419","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","glm(formula = stroke ~ age + avg_glucose_level + heart_disease + \n","    hypertension + bmi + ever_married + bmi, family = binomial(link = \"logit\"), \n","    data = df)\n","\n","Deviance Residuals: \n","    Min       1Q   Median       3Q      Max  \n","-1.1330  -0.2939  -0.1597  -0.0794   3.5722  \n","\n","Coefficients:\n","                   Estimate Std. Error z value Pr(>|z|)    \n","(Intercept)       -7.723696   0.555660 -13.900  < 2e-16 ***\n","age                0.068189   0.005721  11.919  < 2e-16 ***\n","avg_glucose_level  0.004736   0.001286   3.682 0.000232 ***\n","heart_disease1     0.403579   0.203772   1.981 0.047643 *  \n","hypertension1      0.533750   0.173816   3.071 0.002135 ** \n","bmi                0.003750   0.011661   0.322 0.747743    \n","ever_marriedYes   -0.093788   0.241982  -0.388 0.698324    \n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n","\n","(Dispersion parameter for binomial family taken to be 1)\n","\n","    Null deviance: 1728.3  on 4907  degrees of freedom\n","Residual deviance: 1374.4  on 4901  degrees of freedom\n","AIC: 1388.4\n","\n","Number of Fisher Scoring iterations: 8\n"]},"metadata":{},"output_type":"display_data"}],"source":["logit  <- glm(stroke ~ age + avg_glucose_level + heart_disease + hypertension + bmi + ever_married + bmi, family=binomial (link=\"logit\"), data=df)\n","summary(logit)"]},{"cell_type":"markdown","id":"c6775424","metadata":{"papermill":{"duration":0.031349,"end_time":"2022-12-11T02:50:20.592318","exception":false,"start_time":"2022-12-11T02:50:20.560969","status":"completed"},"tags":[]},"source":["<font size=\"3\">The interpretation of the coefficients and the p-values from the summary:</font>\n","* Each one-unit change in age will increase the log odds of having a stroke by 0.06, and its p-value indicates that the variable is significantly important\n","* Each one-unit change in ave_glucose_level will increase the log odds of having a stroke by 0.005, and its p-value indicates that the variable is significantly important\n","* Going to 'having heart disease' from 'not having heart disease will increase the log odds of having a stroke by 0.404, and its p-value indicates that the variable is significantly important\n","* Going to 'having hypertension' from 'not having hypertension' will increase the log odds of having a stroke by 0.534, and its p-value indicates that the variable is significantly important\n","* 'BMI' and 'Ever_Married' variables are not significantly important with the p-value below 0.05\n","\n"]},{"attachments":{"5299873b-7753-42fc-b8ca-8476f3053ea9.png":{"image/png":""}},"cell_type":"markdown","id":"01000a5c","metadata":{"papermill":{"duration":0.016677,"end_time":"2022-12-11T02:50:20.625511","exception":false,"start_time":"2022-12-11T02:50:20.608834","status":"completed"},"tags":[]},"source":["<font size=\"3\">Now, I take 75% of its data to train the model and the rest of its data to test the model. I was able to achieve 96% accuracy and I was happy, but then.. when I looked at the confusion matrix, the true positive (TP) and the false positive (FP) values were missing!</font>\n","\n","![image.png](attachment:5299873b-7753-42fc-b8ca-8476f3053ea9.png)"]},{"cell_type":"code","execution_count":17,"id":"f7bb4886","metadata":{"execution":{"iopub.execute_input":"2022-12-11T02:50:20.66207Z","iopub.status.busy":"2022-12-11T02:50:20.660502Z","iopub.status.idle":"2022-12-11T02:50:20.816299Z","shell.execute_reply":"2022-12-11T02:50:20.809508Z"},"papermill":{"duration":0.18002,"end_time":"2022-12-11T02:50:20.821986","exception":false,"start_time":"2022-12-11T02:50:20.641966","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>3681</li><li>11</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 3681\n","\\item 11\n","\\end{enumerate*}\n"],"text/markdown":["1. 3681\n","2. 11\n","\n","\n"],"text/plain":["[1] 3681   11"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>1227</li><li>11</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 1227\n","\\item 11\n","\\end{enumerate*}\n"],"text/markdown":["1. 1227\n","2. 11\n","\n","\n"],"text/plain":["[1] 1227   11"]},"metadata":{},"output_type":"display_data"},{"name":"stdout","output_type":"stream","text":["[1] \"Accuracy =  0.964955175224124\"\n"]},{"data":{"text/plain":["   predlogit\n","       0\n","  0 1184\n","  1   43"]},"metadata":{},"output_type":"display_data"}],"source":["set.seed(1234)\n","trainIndex = sample(1:nrow(df), size=round(0.75*nrow(df)), replace=FALSE)\n","train <- df[trainIndex,]\n","test  <- df[-trainIndex,]\n","dim(train); dim(test)\n","\n","logit  <- glm(stroke ~ age + avg_glucose_level 